import React from 'react'
import { Card } from 'antd';
import PropTypes from "prop-types";
import { ArrowUpOutlined, ArrowDownOutlined, CopyOutlined } from '@ant-design/icons';
import { useSelector, useDispatch  } from 'react-redux'


const WalletWidget = ({ title, tacBalance, status, address, prefix, extra }) => {
	const {userInfo} = useSelector(state => state.auth)
	const walletAddress = userInfo.walletAddress

	return (
		<Card title='My Wallet' description='헬로?'  extra={extra}>
			<div className={`${prefix? 'd-flex': ''} ${title ? 'mt-0':''}`}>
				{prefix ? <div className="mr-2">{prefix}</div> : null}
					<div>
						<div className="d-flex align-items-center">
							<h1 className="mb-0 font-weight-bold">234232.234234</h1>

								<span className='font-size-md font-weight-bold ml-3 text-success' >
									TAC
								</span> 
						</div>
						{walletAddress && <div className="text-gray-light mt-1">{walletAddress} <CopyOutlined /></div>}
					</div>
				</div>
				<div className="mt-5">
			</div>
		</Card>
	)
}

WalletWidget.propTypes = {
  	title: PropTypes.oneOfType([
		PropTypes.string,
		PropTypes.element
	]),
	tacBalance: PropTypes.number,
	address: PropTypes.string,
	status: PropTypes.string,
	prefix: PropTypes.element,
	extra: PropTypes.object
};

export default WalletWidget
